import React from 'react';

function Todo({ todo, index, attendence }) {
  return (
    <div
      className="todo"
      style={{ textDecoration: todo.isAbsent ? "line-through" : "" }}
    >
      {todo.text}
      <div>
        <button onClick={() => attendence(index)}>Absent</button>
      </div>
    </div>
  );
};

export default Todo;
